    return (
        <div className="tc">
            <h1>RoboSearch</h1>
            <SearchBox />
            <CardList robots={robots} />
        </div>


    )
}*/
class App extends Component {
    constructor() {
        super();
        this.state = {
            robots: robots,
            searchfield: ''
        }
    }
    render() {
        return (
            <div className="tc">
                <h1>RoboSearch</h1>
                <SearchBox />
                <CardList robots={robots} />
            </div>
        );
    }
};
export default App;
